import difflib

cases=[('', '')] 

for a,b in cases:     
    print('{} => {}'.format(a,b))  
    for i,s in enumerate(difflib.ndiff(a, b)):
        if s[0]==' ': continue
        elif s[0]=='-':
            input(u'Delete "{}" from position {}'.format(s[-1],i))
        elif s[0]=='+':
            input(u'Add "{}" to position {}'.format(s[-1],i))    
    input()
